import React from 'react';

// Example project images: put images in src/assets/projects/
const projects = [
  { id: 1, title: 'Workspace 1', img: require('../assets/projects/project1.jpg') },
  { id: 2, title: 'Workspace 2', img: require('../assets/projects/project2.jpg') },
  { id: 3, title: 'Workspace 3', img: require('../assets/projects/project3.jpg') },
];

function ProjectShowcase() {
  return (
    <section id="projects" className="project-grid">
      {projects.map((project) => (
        <div className="project-item" key={project.id}>
          <img src={project.img} alt={project.title} />
          <p>{project.title}</p>
        </div>
      ))}
    </section>
  );
}

export default ProjectShowcase;
